import React from 'react'

class Noice extends React.Component {
    state = {}

    componentDidMount = () => {
        fetch("/api/noice")
            .then(res => res.json())
            .then(noice => {
                this.setState({noice})
            })
    }

    render() {
        return (
            <div>
                {this.state}
            </div>
        )
    }
}

export default Noice
